import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

let Title = styled.div`
  font-size: 2rem;
  padding: 0.5rem;
  text-align: center;
  background-color: grey;
  border-radius: 1rem;
  width: 50%;
  color: darkgrey;
`;
let CenterBox = styled.div`
  text-align: center;
`;

let MainWrap = styled.div`
  max-width: 1300px;
  margin: auto;
`;

let Navbars = styled.div`
  text-align: center;
  background: navy;
  color: white;
  padding: 1rem;
  font-size: 2rem;
`;

let Searchbox = styled.div`
  text-align: center;
  background: grey;
  color: darkgrey;
  padding: 0.5rem;
  border-radius: 1rem;
`;

function App() {
  return (
    <MainWrap className="App">
      <Navbars>SNS Music</Navbars>
      <CenterBox>
        <Searchbox>검색</Searchbox>
      </CenterBox>
    </MainWrap>
  );
}

export default App;
